description:
The Bureau of Fisheries and Aquatic Resources of the Department of Agriculture, through its National Fisheries Program implements different projects and programs that helps to improve the lives of the fisherfolks, prevent, deter and eliminate all forms of illegal, unregulated and unreported fishing and ensure the management and sustainability of fisheries resources.
Its sub-programs include:

A. Fisheries Development Program, which includes aquaculture (provision of fingerlings/broodstocks, cages, and seaweed propagules and farming implements); capture fisheries (provision of fiberglass boats and fishing gear and paraphernalia); post-harvest; and marketing development;

B. Fisheries Regulatory and law Enforcement Program;

C. Fisheries Extension Program, which includes extension, support, education and training services; establishment of technodemo farms; information support services; and stakeholders collaboration and partnership;

D. Fisheries Policy Program

output:
1. Beneficiaries were provided with technical assistance, trainings, and production and livelihood support/services in both aquaculture and capture fisheries;
2. Violations and applications for permits, licenses, etc. are acted upon;
3. Fishery facilities and products are monitored;
4. New fisheries policies are formulated and some of the existing ones are reviewed.

