description:
Corn Program consist of 6 components/activities:
1. Production Support Services (PSS) - to ensure availability of quality seeds and planting materials that can be accessed by farmers, establishment of storage facilities of bufferstock to be used as storage facility of seeds to maintain quality and ensure its availability in times of calamities;
2. Market Development Services (MDS) - facilitation of market matching activities to encourage marketing tie-ups and contract growing arrangements in the farm clusters;
3. Extension Support, Education and Training Support Services (ESETS) - conduct of trainings and information dissemination that would empower farmers and extension workers; 
4. Research and Development (R&D) - conduct of researches on corn and cassava technologies through the Bureau of Agricultural Research (BAR) and DA-RFOs ;
5. Irrigation Network Planning and Contract Management Services - provision of appropriate irrigation technology for corn production; and
6. Provision of Agricultural Equipment and Facilities (PAEF) - provision of farm mechanization and postharvest machinery, equipment and facilities to corn and cassava farmers to increase productivity, competitiveness of local production and to minimize reduction from postharvest losses.

output:
Production and distribution of seeds and planting materials;
Establishment and Maintenance of Seed Storage Facilities;
Procurement of equipment and machinery in support to DA-Station;
Organize and strengthen clusters that will increase bargaining power for farmers and facilitate market linkages for their produce;
Empower corn and cassava farmers and LGU partners through recognitions, conduct of various trainings and demonstrations relative to Good Agricultural Practices (GAP), latest technologies on cost efficiency, and appropriate mechanization and postharvest technologies;
Conduct of other researches on corn and cassava aimed at increased productivity and cost efficiency, such as the Site Specific Nutrient Management; and
Provision and construction of STW, Open Source Pumps and other alternative irrigation system (e.g. Solar Powered Irrigation System).
